const courseData = [
  {
    heading:'JEE',
    subHeading:'This is a great way to create great slogans for business Focus',
    src:course1img,
  },
  {
    heading:'NEET',
    subHeading:'This is a great way to create great slogans for business Focus',
    src:course2img,
  },
  {
    heading:'UPSC',
    subHeading:'This is a great way to create great slogans for business Focus',
    src:course3img,
  }
]
const HomeCourses = () => {
  return (
    <div>
      <div>
        <div>
          <div></div>
          <h1>
            All Courses
